import React from "react";

const WeatherIcon = props => (
  <>
    {props.icon}

    {(props.icon.props.value === "clear") &
    (props.condition.toLowerCase() === "clear") ? (
      <input type="checkbox" checked />
    ) : (
      <input type="checkbox" />
    )}

    {(props.icon.props.description === "few clouds" ||
      props.icon.props.description === "scattered clouds" ||
      props.icon.props.description === "broken clouds") &
    (props.condition === "partly cloudy") ? (
      <input type="checkbox" checked />
    ) : (
      <input type="checkbox" />
    )}

    {(props.icon.props.description === "overcast clouds") &
    (props.condition.toLowerCase() === "clouds") ? (
      <input type="checkbox" checked />
    ) : (
      <input type="checkbox" />
    )}
  </>
);

export default WeatherIcon;
